import React, { Component } from 'react'
import './home.css'

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <div className='header'>
            <img id="Green_Logo" src="./public/Green_Logo.png" srcSet="Green_Logo.png 1x, Green_Logo@2x.png 2x" />
        </div>
    )
}

}
